CREATE DATABASE bank_lockers01;
USE bank_lockers;

CREATE TABLE bank_locker_details (
    aadharid BIGINT PRIMARY KEY,
    fname VARCHAR(50),
    lname VARCHAR(50),
    amount DECIMAL(12,2),
    gold DECIMAL(10,2),
    silver DECIMAL(10,2),
    deposit_date DATE,
    maturity_date DATE,
    date_of_birth DATE,
    bank_passbook VARCHAR(20),
    
    employer_type ENUM('Businessman', 'FullTime', 'PartTime'),
    
    state VARCHAR(50),
    phone_number BIGINT,
    email VARCHAR(100),
    charges DECIMAL(8,2),
    branch_name VARCHAR(50),
    rate_of_interest DECIMAL(5,2),
    
    account_type VARCHAR(30),
    loan_eligibility VARCHAR(10),
    civil_score INT,
    locker_number INT UNIQUE,
    
    gender ENUM('Male', 'Female', 'Other'),
    atm_card_type VARCHAR(30),
    credit_card_eligibility ENUM('Yes', 'No'),
    
    personal_advice TEXT,
    personal_advice_rating INT
);


select * from bank_locker_details;
SELECT COUNT(*) FROM bank_locker_details;